import sys

# Walk through all Python files and check for syntax errors
def check_syntax_errors\(\):
    errors = []
    for root, dirs, files in os.walk\(''.''\):
        for file in files:
            if file.endswith\(''.py''\) and not file.startswith\(''.''\) and ''.venv'' not in root:
                filepath = os.path.join\(root, file\)
                try:
                    with open\(filepath, ''r'', encoding=''utf-8''\) as f:
                        source = f.read\(\)
                    ast.parse\(source\)
                except SyntaxError as e:
                    errors.append\(\(filepath, e\)\)
                except Exception as e:
                    # Skip other errors \(like encoding issues\)
                    pass

    if errors:
        print\(f''Found {len\(errors\)} syntax errors:''\)
        for filepath, error in errors:
            print\(f''  {filepath}: {error}''\)
    else:
        print\(''No syntax errors found!''\)

    return len\(errors\)

num_errors = check_syntax_errors\(\)
sys.exit\(num_errors\)
